import Input from "../../UI/Input";
import styles from "./TireItemForm.module.css";

const TireItemForm = (props) => {
  return (
    <form className={styles.form}>
      <Input
        label="Кількість"
        input={{
          id: props.id,
          type: "number",
          min: "1",
          step: "1",
          defaultValue: "1",
        }}
      />
      <button>Додати</button>
    </form>
  );
};

export default TireItemForm;
